  `LINK_REFER` varchar(500) CHARACTER SET latin1 COLLATE latin1_swedish_ci DEFAULT NULL COMMENT 'Source',
  `POSITION` int(11) DEFAULT 0,
  `DEPARTMENT` int(11) DEFAULT 0,
  `UNIVERSITY` int(11) DEFAULT 0,
  `EXPERIENCE` varchar(1000) DEFAULT NULL,
  `YEAR_OF_EXPERIENCE` int(11) DEFAULT 0,
  `EXPECT_SALARY` varchar(100) DEFAULT NULL,
  `EXPECT_START_DATE` datetime DEFAULT NULL,
  `INTERVIEW_DATE` datetime DEFAULT NULL,
  `INTERVIEWER` int(11) DEFAULT 0,
  `INTERVIEW_RESULT` int(11) DEFAULT 0,
  `CREATE_AT` datetime DEFAULT NULL,
  `CREATE_BY` varchar(11) CHARACTER SET latin1 COLLATE latin1_swedish_ci DEFAULT NULL,
  `UPDATE_AT` datetime DEFAULT NULL,
  `UPDATE_BY` varchar(11) CHARACTER SET latin1 COLLATE latin1_swedish_ci DEFAULT NULL,
  `DELETE_AT` datetime DEFAULT NULL,
  `STATUS` int(11) DEFAULT NULL,
  `LINK_CV` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=69 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
