CREATE  FUNCTION `get_total_score`(p_exam_id INT) RETURNS int(11)
BEGIN

    DECLARE total_score INT;

    SELECT SUM(tea.SCORE) INTO total_score

    FROM tb_excan_exam_question teeq

    JOIN tb_excan_answer tea ON teeq.QUESTION_ID = tea.QUESTION_ID

    WHERE teeq.EXAM_ID = p_exam_id;

    RETURN total_score;

END ;;
